INSERT INTO public.news_posts (id, slug, cover_img, title, content, created_at, updated_at) VALUES (4, 'vong-chung-ket-giai-bong-da-quoc-gia-danh-cho-tre-em-co-hoan-canh-dac-biet-20195dcb090a305ee', '/images/news-default.jpg', 'Vòng chung kết giải bóng đá quốc gia dành cho trẻ em có hoàn cảnh đặc biệt 2019', '<p><span style="color: rgb(28, 30, 33); font-family: Helvetica, Arial, sans-serif; font-size: 14px;">Bước vào Vòng chung kết Giải bóng đá trẻ em có hoàn cảnh đặc biệt toàn quốc năm 2019, Đội bóng Quỹ Bảo trợ trẻ em tỉnh Điện Biên đã có 3 trận đấu toàn thắng và lọt vào tứ kết. Chúc mừng các cầu thủ nhí, các con thật tuyệt vời&nbsp;</span><img style="width: 960px;" src="data:image/jpeg;base64," data-filename="67587195_926575767700112_4946499115950276608_o.jpg"><img style="width: 960px;" src="data:image/jpeg;base64," data-filename="67742594_926575624366793_8823320683913150464_o.jpg"><img style="width: 960px;" src="data:image/jpeg;base64,', '2019-11-12 19:33:30', '2019-11-12 19:33:30');
INSERT INTO public.news_posts (id, slug, cover_img, title, content, created_at, updated_at) VALUES (3, 'giai-bong-da-quoc-gia-danh-cho-tre-em-co-hoan-canh-dac-biet-20195dcb08a24ead0', '/uploads/1576256303_4796913_3b4f6e443ddc76a76fdc25f45d6d1f67.jpg', 'Giải bóng đá quốc gia dành cho trẻ em có hoàn cảnh đặc biệt 2019', '<p><span style="color: rgb(28, 30, 33); font-family: Helvetica, Arial, sans-serif; font-size: 14px;">Sau gần 2 tháng luyện tập đội bóng của Quỹ Bảo trợ trẻ em tỉnh Điện Biên gồm 10 cầu thủ nhí (Làng trẻ em SOS Điện Biên Phủ và Trung tâm Bảo trợ xã hội) tham gia giải bóng đá dành cho trẻ em có hoàn cảnh đặc biệt toàn quốc. Trận đấu khai mạc giữa Điện Biên - Phú Thọ đã kết thúc với kết quả 1-1. Sự quyết tâm, nỗ lực hết mình, niềm đam mê và khát khao chiến thắng của các đội tham gia giải đấu làm cho chúng ta tin tưởng sẽ có nhiều con có cơ hội được tham gia vào đội bóng quốc gia trong tương lai. P.s Chúc cho các con của đội bóng Quỹ Bảo trợ trẻ em tỉnh Điện Biên sẽ lọt vào vòng chung kết. Cố lên các con!</span><img style="width: 960px;" src="data:image/jpeg;base64," data-filename="65000263_898152653875757_6906647693636927488_n.jpg"><img style="width: 720px;" src="data:image/jpeg;base64,', '2019-11-12 19:31:46', '2019-12-13 16:58:23');
INSERT INTO public.news_posts (id, slug, cover_img, title, content, created_at, updated_at) VALUES (5, 'tang-qua-cho-tre-em-kho-khan-nhan-dip-trung-thu5dcb097bbc194', '/uploads/1576257179_3397913_011448cccbc242c6ff6495023934896e.jpg', 'Tặng quà cho trẻ em khó khăn nhân dịp trung thu', '<p><span style="color: rgb(28, 30, 33); font-family: Helvetica, Arial, sans-serif; font-size: 14px;">Trung thu đến sớm cho những trẻ em có hoàn cảnh khó khăn tại xã Xa Dung, huyện Điện Biên Đông. Ngày 07 tháng 9 năm 2019, Quỹ Bảo trợ trẻ em tỉnh Điện Biên phối hợp với nhóm thiện nguyện Sen Hồng – Uông Bí tổ chức Vui tết trung thu năm 2019 cho trẻ em nghèo là con em dân tộc thiểu số xã vùng cao Xa Dung – Điện Biên Đông, tỉnh Điện Biên. Với 20 suất quà dành tặng cho trẻ em có hoàn cảnh đặc biệt khó khăn, 50 suất đồ dùng học tập, các loại bánh kẹo, đèn ông sao, đồ chơi mầm non</span><span class="text_exposed_show" style="display: inline; font-family: Helvetica, Arial, sans-serif; color: rgb(28, 30, 33); font-size: 14px;">, dầu ăn, mì tôm, lạc, vừng...dành cho Trường mầm non Xa Dung, PTDTBT Xa Dung với tổng kinh phí trên 50 triệu đồng đã được trao tận tay cho các em. Với mong muốn dành tặng cho các em nhỏ có hoàn cảnh khó khăn những tình cảm yêu thương ấm áp.<br>Nhìn ánh mắt lấp lánh niềm vui, nụ cười rạng rỡ của các em, Quỹ Bảo trợ em em và nhóm thiện nguyện Sen Hồng – Uông Bí cảm thấy ấm lòng. Hy vọng sẽ có nhiều đơn vị, các nhà hảo tâm cùng chung tay với công tác bảo vệ và chăm sóc trẻ em có hoàn cảnh khó khăn, trẻ em vùng sâu, vùng xa hơn nữa bởi sự quan tâm đó sẽ tiếp thêm niềm tin và động lực cho các em trong cuộc sống.</span></p><p><img style="width: 960px;" src="data:image/jpeg;base64," data-filename="69796163_950002718690750_3284085462293020672_n.jpg"><img style="width: 720px;" src="data:image/jpeg;base64,', '2019-11-12 19:35:23', '2019-12-13 17:12:59');